import React from 'react';

class PrimaryContent extends React.Component {
  render () {
    switch (this.props.primaryNavigationBarSelection) {
      case 'home':
        return (
          <Home />
        )
      case 'about-me':
        return (
          <AboutMe />
        )
      case 'work-experience':
        return (
          <WorkExperience />
        )
      case 'projects':
        return (
          <Projects />
        )
      case 'contacts':
        return (
          <Contacts />
        )
    }
  }
}

export default PrimaryContent;
